css:
@-moz-document domain("musicbrainz.org") {
body{padding:0;color:white}

#header-logo{background-image: url(http://i.imgur.com/bcpy9dK.jpg)}

div.artwork-cont{background-color:#333}

body, #page, #release-editor fieldset, div#content, .pBody, .portlet, div#footer, div iframe body #page, body #page, .content-loading, .iframe-dialog iframe body, .iframe-dialog iframe html{background-color:#454545;}
#page{background-image:none}

table.tbl tr.ev td, table.tbl tr.ev th, .search-help, .edit-list .edit-header, .edit-list .edit-actions, table.statistics th, div.documentation div.bubble,.wikicontent table[border^="1"] tr:nth-child(odd) td, .wikicontent table.wikitable tr:nth-child(odd) td, .wikicontent #toc, .wikicontent .toc, .edit-notes .edit-note h3, #release-editor div.select-recording,table[border^="1"] tr:nth-child(odd) td, table.wikitable tr:nth-child(odd) td, table.tbl tr.even td, table.tbl tr.even th, #release-editor #recordings fieldset table tr.even td{background-color:#626262;}

table.tbl thead tr{height: 22px;}
table.tbl th{border:solid 1px #666;}

body #edits .edit-list .edit-header{border-radius:5px 5px 0 0;}
.edit-list .open.edit-add, .open.edit-add{background-color:#698C69}
.edit-list .edit-add{background-color:#596659}
.edit-list .edit-remove{background-color:#B5A1A4}
.edit-list .edit-edit, .edit-list .open.edit-edit{background-color:#8F8B6B}
.edit-list .edit-merge{background-color:#998799}
.edit-list p.subheader{margin-bottom:6px;margin-top: 5px;}
.edit-list .edit-other{background-color:#819196}

form div.row label{margin-top: .5em;}

.edit-list, #filter, div.dialog, .warning-header, .server-details, .nagpanel, .catlinks, div.noarticletext, #toc, .toc, table[border^="1"] tr:first-child th, table.wikitable tr:first-child th{background-color:#626262;border-radius: 5px}

#header-menu ul.r{margin-right:30px}
#header-menu{border-radius:0}

#page, h1, h1 a, #footer, div#content, .ui-menu .ui-menu-item a{color:white !important;}

.mp, #content.rel-editor .warning, div.rel-editor-dialog .warning{color:black}

h3{color:#FEBE53}

#release-editor div.changes div.notice, div.warning, .wikicontent code, .wikicontent pre, .new, .old{color:black}

.flash {font-weight: bold; color: gray;}

div.ar-descr{background:transparent;}

table.tbl {border: 1px solid #666;}

a, #footer a, .edit-notes .edit-note .date, #content.rel-editor .btn, tr.subh a:visited, .btn-link{color:#9cf;}

a:visited{color:#968edf;text-shadow:1px 1px 2px grey;} 

table.tbl th a, dl.ars dt{color:LightGray !important;}

table.tbl th, table.tbl tr.subh td, table.tbl tr.subh th{ background:#4f4f4f !important}

#release-editor .medium.tbl tr.track td{background-color: #555;}
#release-editor .medium.tbl tr.track td{border: 1px dotted #444;}
.file-down, .move-down, .track-down, .file-up, .move-up, .track-up, #release-editor fieldset.advanced-disc button.disc-down, #release-editor fieldset.advanced-disc button.disc-up{background-image: url(data:image/png;base64,)}
.file-up, .move-up, .track-up, #release-editor fieldset.advanced-disc button.disc-up{transform: rotate(180deg);}

.buttons a, .buttons button, .buttons input[type=submit], .buttons input[type=button], #searchGoButton:hover, #searchGoButton:focus, input.searchButton:hover, input.searchButton:focus
{background:#AAA;border:solid 1px silver;color:#222 !important;border-radius:3px}

.buttons a.positive:hover, .buttons a.positive:focus, .buttons input[type=button].positive:hover, .buttons input[type=button].positive:focus, .buttons input[type=submit].positive:hover, .buttons input[type=submit].positive:focus, .buttons button.positive:hover, .buttons button.positive:focus, .buttons input[type="button"].parse-tracks:hover{background:#E6EFC2;}

div.tabs ul li a{background:#fefefe;color: #000 !important; padding-top: 3px;border: solid 1px #fefefe;}
div.tabs ul li.sel a{background: #454545;border-bottom: solid 1px #454545;color:#fefefe !important}

div.tabs {border-bottom: solid 1px #fefefe;}

.annotation-collapsed:after, .review-collapsed:after, .wikipedia-extract-collapsed:after{background: -webkit-linear-gradient(top, rgba(69,69,69,0) 0%,rgba(69,69,69,1) 100%)}

div[style*="border-top-right-radius: 12px; width: 12px"],
div[style*="border-bottom-right-radius: 12px; width: 12px;"]
{background-color:#454545 !important;}
div[style*="left: -12px"]{background-color:#535353 !important;}

input, select, textarea{padding: 3px;background-color: #ace;border:1px solid #ace}
#edit-search select{padding: 2px; margin:2px}
select[disabled]{background-color:gray;border: 1px solid gray;}

a span[class^="diff-only-"], span[class^="diff-only-"] a, .mp a, .new a, .rel-edit a{color:#002BBA !important}

table.tbl tr.mp td, div.mp, tr.diff-changes, .wikicontent code{padding:2px}

.artistheader {
    background-image: url(data:image/png;base64,);}

.small-star, .small-star a:hover, .small-star a:active, .small-star a:focus, .small-star .current-user-rating, .small-star .current-rating{background-image: url(data:image/png;base64,);}

.allmusic-favicon{background-image: url(data:image/png;base64,);}

#page #sidebar ul.external_links li.all-relationships{background-image:
url(data:image/png;base64,);height:20px;}

#page #sidebar ul.external_links li.discogs-favicon, span.discogs-favicon{background-image: url(data:image/png;base64,);}

.wikipedia-favicon {background-image: url(data:image/png;base64,);}

.facebook-favicon{background-image: url(data:image/png;base64,);}

.myspace-favicon{background-image: url(data:image/png;base64,);}

.iTunes-favicon{background-image: url(data:image/png;base64,);}

.lastfm-favicon{background-image: url(data:image/png;base64,);}

.soundcloud-favicon{background-image: url(data:image/png;base64,);}

.bandcamp-favicon{background-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABAAAAAQCAYAAAAf8/9hAAAAYUlEQVR4AWPABKMgceYKGyD+TyReis2Aw0Rq/gnEiuiao0iwvR1dMxsQ3yZS81sg5kE3oIIE2zPRNQsB8QciNd8AYmZ0A6aRYLs3umZ1IP5DpOZd2KJtCzGaoZYYDMOkDwCHSBUsA2YO7gAAAABJRU5ErkJggg==);}

.rateyourmusic-favicon{background-image:url(data:image/png;base64,);}

.spotify-favicon{background-image:url(data:image/png;base64,);}

a.external, a.external:active, a.external:focus, a.extiw, a.extiw:active, a.extiw:focus, a:active, a:focus{color:#39f !important}

a.new, #quickbar a.new, #p-personal a.new{color:#F90 !important}

div[style*="background-color:#FFFAF5"], #release-editor #recordings fieldset table tr.ev td, #current-editing, [style*="background-color: #f8f8f8"]{background-color:#555 !important}
#current-editing{border: 1px solid #ffba58;margin:10px}

.edit-notes .modbot{color:#AAA}

#sidebar {border-left: dashed 1px silver;padding-left: 15px;}
table.database-statistics tr.thead th{background-color:#333}
#graph-container, #rate-of-change-graph {height: 500px;background-color: #bbb;}
div.artwork-cont{padding:10px !important}
#release-editor fieldset.editnote textarea{width:700px;}
div fieldset.editnote textarea.edit-note{min-width:30%;width:60%}
table.details th{width:200px}
div.bubble{min-height: 58px !important;}
div.bubble.left-tail:before{border-right-color: #626262;}
div.bubble{background:#777}
div.bubble.right-tail:after{border-left: 18px solid #777;}
#release-editor #track-ac-bubble{box-shadow: 2px 2px 16px #222;}
#catlinks, #toc{border-radius: 8px;margin-bottom: 5px;}
table[style*="background:#FFFDDF"]{color:black}
.pageselector a, .pageselector span{padding: 4px 6px 3px 6px;border-radius: 5px;}
.pageselector a:hover{background-color:#FFE326}
.pageselector span{background-color:#777;border: solid 1px #444;}
.mbwiki-navbox-rowtitle{background-color:transparent}
div.rel-editor-dialog{background: #777 !important;}
div.rel-editor-dialog table td.section{vertical-align: middle;}
div.rel-editor-dialog .warning {color: black;}
#tooltip{color:black}
#content .open.edit-add, #content .open.edit-remove {padding: 5px; border-radius: 5px;}

/* AutoPager Styling */
div.autoPagerS{padding: 5px;color: black;border-radius: 5px;}
div.autoPagerS img{height:initial !important;}
div.autoPagerS a{color:#002bba}
div.autoPagerS a[name="xxAutoPagerRate"]{display:none}
/* AutoPager Styling End */

/* tracklist editor */
#release-editor fieldset.advanced-disc tr.track>td>input[type=text], #release-editor .medium.tbl tr td, #release-editor .medium.tbl tr.track-artist-credit>td{color:#DDD;background-color:#555}
#release-editor .medium.tbl tr.track-artist-credit td table, #release-editor .medium.tbl tr.track-artist-credit td table td{background-color:#777}
#release-editor .medium.tbl td input[type=text]{height:inherit;border-radius:0}
#release-editor .medium.tbl td.credits-button button{border-radius: 0}
/* end tracklist editor */

.editnote textarea{min-width:700px}

span.error, div.error{color:#fc6714 !important}

body .ui-widget-content, body .ui-tabs .ui-tabs-nav{background-color:#454545; background-image:none;}

/*Loading image*/
.loading-message, #page .loading-tab, #page .content-loading, .ui-autocomplete-loading, .content-loading, .loading{background-image:url('data:image/svg+xml;base64,') !important}
input.ui-autocomplete-loading, .loading{background-repeat: no-repeat !important;}
input.ui-autocomplete-loading{background-position: 99.5% 50% !important;}

.loading-message{padding-bottom:2px}

img[src="../../../static/images/icons/loading.gif"]{content:url('data:image/svg+xml;base64,')}

.wikicontent table[border^="1"] tr:nth-child(even) td, .wikicontent table.wikitable tr:nth-child(even) td{background-color:transparent}

.banner {
    color: black;
}

/* Nag Panel */
.nagpanel{display:none}
}

@-moz-document domain("blog.musicbrainz.org") {
body{background-color:#535353 !important;color:white !important}
a:visited{color:#968edf !important}
h1 a{color:#fc6714 !important}
h1 a:visited{color:#ACB714 !important}
a{color:#9cf !important;}
h2, h2 a, h2 a:visited, h3, h3 a, h3 a:visited, .post-content p, .post-content li, .post-content dd, .post-content dt, .post-content pre, .post-content address, .post-content div, .post-content kbd, .post-content tt, .post-content var{color:white !important}

.post-content h1, .post-content h2, .post-content h3, .post-content h4, .post-content h5{color:#FEBE53 !important}

.post-meta, .post-content, .widget, #respond h3#reply-title, #respond{border:none !important}
article{border-bottom: 1px solid #e9e9e9;}

.post-content pre {background: #777 !important}

.thread-even, .thread-alt{background-color:#555}

#header hgroup{display:none;}
#header .search-form-holder{top:107px !important;margin-right:5px}
.middle #content{background-color:transparent;}

#access{margin:73px 0 5px 10px !important}
div.bubble{background-color:#555;border: 1px solid #666;}
}

@-moz-document domain("wiki.musicbrainz.org") {
div#content{background: #555;border-radius: 8px;}
#p-cactions li{background-color: #736DAB;}
#p-cactions li a, #p-cactions li.selected a{background:transparent}
#p-cactions li{border-top-left-radius: 4px;border-top-right-radius: 4px;}
#p-cactions li.selected{background:#555 !important}

table[style*="background:#FFFDDF"]{background:#9E9E74 !important}
td[style="border:1px solid #ffcc00;"]{border:1px solid #BCBC8B !important}
#toc h2{color:white}

.mediawiki table.wikitable, .mediawiki table.wikitable > tr > th, .mediawiki table.wikitable > * > tr > th, .wikicontent table[border^="1"] tr:nth-child(even) td, .wikicontent table.wikitable tr:nth-child(even) td{background-color:transparent}

.mediawiki code{color:black}
.mediawiki table.wikitable{color:white}
}

@-moz-document domain("tickets.musicbrainz.org") {
table.ie-f, .filter-description, .filterFormCell, .filterSummaryCell, #filterForm .fieldLabelArea, #filterForm .fieldLabelAreaTop, #filterForm td, .footer, #quicksearch, ul.tabs li.tab-title, #jira table
  {background-color: transparent;}
#quicksearch{border:none;top: 3px;}
#header-top div.aui-dd-parent {padding: 0.4em .31667em 0 .4em;}
label.overlabel-apply {top: 3px;}

.rowNormal{background-color:#454545}
#filterForm .rowHeader, .rowHeader, .rowAlternate, .jiraformheader, .jiraformSectionBreak {background-color: #666;}
.redText{color:#FEBE53}

a:link{color:#9cf}
#issuetable .parentIssue {color: #9cf9cf;}

/* Buttons */
input[type=submit], input[type=button]{border-radius:7px;background:linear-gradient(to bottom, #bababa 0%,#757575 100%);border:solid 1px silver;color:#222 !important}

input[type=submit]:focus, input[type=submit]:hover,
input[type=button]:focus, input[type=button]:hover
{background: linear-gradient(to bottom, #dff0ff 0%,#8fcaf7 100%); cursor:pointer}

table TD.unselectedRow{background-color:#AAA}
table TD.selectedRow{background-color:#9a6;}

table.jiraform{border:none; margin-top:5px;}

table #filterForm .headerClosed{background-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAoAAAAKCAYAAACNMs+9AAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAAG9JREFUeNpiYCASMMIYq868Ww+kHIA4MMxE6AC6QiY0vgAQ7wdqKsCnMBGIF0DZ/UDF84FYAMNqJCeATOuHci9AnfKAiRzPCEBNSoAKgZxRCDTtA4jDgqRpPhAHQNkgBROQTWRBs+EDruAhGgAEGACggCDl2kPedAAAAABJRU5ErkJggg==);}

table #filterForm .headerOpened{background-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAoAAAAKCAYAAACNMs+9AAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAAGxJREFUeNpiYCAFrDrzTgGE8YkzQcXOgzBQ0ABJkQFMHMRngYpfAGIHIF4PVGAIFVsPxAJAfABZYSBUpwJUAQOU/QAqx8CIZtV+qCkg8AGIHcNMhC4gu5EBKlCI5JdCmCJcIdAPwgw0BwABBgCHESs1bDIWjQAAAABJRU5ErkJggg==);}
}

@-moz-document domain("forums.musicbrainz.org") {
.main-pagepost, .post, .gen-content, .main-content, .posthead, .postbody, .post-options , .main-subhead {background:transparent;}

.posthead .hn, .entry-content .quotebox, .entry-content .codebox {background-color:#555}

#brd-wrap a{color:#9cf}
#brd-wrap a:visited{color:#968edf}

#brd-wrap .main-head a{color:black}

#brd-wrap ul li strong{color:silver}

#brd-wrap #brd-navlinks a:visited{color:black}

#brd-wrap .main-content .sticky {background: #545454;}

#brd-wrap .item-status em.closed, #brd-wrap .main-content .main-item .hn .item-status em.sticky, #brd-wrap .main-content .main-item .hn .item-status em.closed {color:#FEBE53}

#brd-wrap #brd-pagepost-top{border-radius: 7px 7px 0 0;}

#brd-wrap .entry-content .quotebox, #brd-wrap .entry-content .codebox {border-radius: 8px;}
}
